          </NavItem>
          <Nav.Link path="/bout-us">About Us</Nav.Link>
          <Nav.Link href="/vision">Our Vision</Nav.Link>
          <Nav.Link href="/login">Login</Nav.Link> */}
        </Navbar>
      </div>
      <div>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route
            render={function () {
              return <p>Not found</p>;
            }}
          />
        </Switch>
      </div>
      <div>
        <h3 className="content">
          Find new and
          <br />
          meaningful
          <br />
          connections
          <br />
          easily
        </h3>
        <p className="content-paragraph">
          Create new friendships and meet
          <br />
          new people around you based on
          <br />
          your mutual interests and hobbies
        </p>
        <Button href="#" variant="primary">
          Flask says: {placeholder}
        </Button>
        {/* <p className="i-want-button">Flask says {placeholder}</p> */}
      </div>
    </div>
  );
};

export default App;
